(82, 63, 'INV00000082', '2017-07-27', '2017-08-03', 0, 3, 1, 2, 0, 'B.E. Cooling', 'No. 1 Capricon Boulevard, Capricon Park,Muizenberg ', 'PO 3425 ', 'Capetown', 'Capetown', '7945', 192, 'Total Mtuba\n10065859 - 33628\n21.06.2017 / 17.07.2017\nIce Freezer Room\nQuotation : QRB234\n\nWe were called out to the Supermarket Ice Freezer not cooling.  Found the refrigerant plant low on oil due to a faulty oil separator and the unit was also short of refrigerant.  We conducted a refrigerant leak test on the indoor and outdoor refrigerant plant.  Found the refrigerant leak on the outside unit, repaired leak using welding.  Evacuate refrigerant plant of any contamination, commission plant with new refrigerant gas that was lost.  Check all settings and parameters.  We recommend the oil separator be replaced as soon as possible.', NULL, 0, NULL),
