(305, 78, 'INV305', '2017-08-31', '2017-09-07', 0, 2, 1, 2, 0, 'B.E. Cooling', '5 Byrne Street', '', 'Empangeni', 'KwaZulu Natal', '3880', 192, '26.07.2017\n\nService carried out on 2 x Ducted Airconditioning Units\n\n1. Remove any debris / plastic from condenser.\n2. Wash condenser coils with acid\n3. Check all condenser fans for visible defaults / broken, cracked blades, balancing, no obstructions\n4. Check wiring, sealed covers, water damage on all condenser fans\n5. Check main condenser boards for visible defaults (burnt wiring, loose connections etc)\n6. Check fan electrical main boxes are closed and sealed\n7. Check all aircon pipe brackets are tight and secure and any visible friction marks\n8. Remove and clean evaporator filters\n9. Remove and clean indoor evaporator aircon covers\n10. Check and clean indoor evaporator coil\n11. Check and clean drip trays\n12. Clear drains, push water down drains\n13. Check evaporator fan for visible defaults / broken, cracked blades, balancing, no obstructions \n14. Check electrical connections\n15. Refrigerant leak test\n16. check for visible problems (broken covers, missing components, remote functioning)\n17. Check refrigerant levels', NULL, 0, NULL),
