(408, 21, 'INV408', '2017-09-19', '2017-09-26', 0, 1, 0, 2, 0, 'Faith (Zandile) Majozi', 'P.O. Box 40696, Redhill', '', 'Durban', 'KZN', '4071', 192, 'Job Card : 00497, 02870 & 02631\n18.08.201, 31.08.2017, 08.09.2017 \n\nRack 002\n\nFound system short of refrigrerant gas checked through system found multiple small leaks, continued leak testing on all individual evaporator coils found coils found gas leak on freezer room blower coil (We have submitted quote QRB203 to replace blower coil and install new unit as this a problematic fridge) Repaired gas leak, commissioned system. \n', NULL, 1, '2017-09-21 11:24:10'),
(409, 21, 'INV409', '2017-09-19', '2017-09-26', 0, 1, 0, 2, 0, 'Faith (Zandile) Majozi', 'P.O. Box 40696, Redhill', '', 'Durban', 'KZN', '4071', 192, '02369, 02760, 02620 & 02872\n23.08.2017, 01.09.2017, 04.09.2017 & 09.09.2017\n\nLT Rack 002\nBE008\n\nFound Rack had tripped on oil, topped up oil in system monitored system, found 1 x compressor tripped on head pressure and blown safety release valve, stripped compressor found oilpad faulty causing compressor valve head to fill with oil, replaced oil pad, safety valve, oil, recommissioned system and checked all settings BE008freezer room was effected by Rack, after accessing freezer it is recommended to replace blower coil. ', NULL, 1, '2017-09-21 11:27:20'),
(410, 21, 'INV410', '2017-09-19', '2017-09-26', 0, 1, 0, 2, 0, 'Faith (Zandile) Majozi', 'P.O. Box 40696, Redhill', '', 'Durban', 'KZN', '4071', 192, '00440 & 02601\n24.08.2017 & 25.08.2017\n\nMT Rack 001\n\nMT Rack tripping on oil on compressor 1+ 3. Changed oil on all 3 compressor, cleaned oil strainers, found oil return line blocked, repaired found 1 x oil control faulty on compressor 2 replaced, once oil faulty repaired, discovered Rack had gas leak found ball valve leaking, replaced with new ball valves and recharged system with refrigerant. ', NULL, 1, '2017-09-21 11:31:22'),
