(412, 5, 'INV412', '2017-09-19', '2017-09-26', 0, 0, 0, 2, 0, 'Barbara Cilliers', 'Private Bag X9008', 'Crown Mines', 'Durban', 'KZN', '2025', 192, 'NONGOMA\n\nCF20035134 - 3025955\n\nSupermarket Cool drink Wall Chiller - 5050\nSupermarket Cool drink Wall Chiller - 3792\n\n5050 - Not Cooling - Checked and found unit short of refrigerant.  Leak checked and found leak on liquid line.  Repaired using piping and welding.  Replaced refrigerant lost.  Leak checked again.  All ok.\n\n4164 - Leaking Water - Checked and found drain pipe moved out of position.  Moved drain pipe back into position and secured.', NULL, 0, NULL),
