(415, 5, 'INV415', '2017-09-19', '2017-09-26', 0, 0, 0, 2, 0, 'Barbara Cilliers', 'Private Bag X9008', 'Crown Mines', 'Durban', 'KZN', '2025', 192, 'NONGOMA\n\nCF20035349 - 3026171\n\nButchery Freezer Room - 3075\n\n1.  Water Leak - Checked and found the drain leading from the drain pan is broken, causing ice to form.  The drainage is still PVC, need to convert to copper piping.  Returned the next day.  Removed the ice. Removed old PVC drainage and replaced with copper piping, armeflex and drain heaters.  Tested.\n\n2.  Panel is loose - Checked and found a panel damaged and moved out of position.  Replaced aluminium angles on panel and secured back into position.    ', NULL, 0, NULL),
