(418, 21, 'INV418', '2017-09-19', '2017-09-26', 0, 1, 0, 2, 0, 'Faith (Zandile) Majozi', 'P.O. Box 40696, Redhill', '', 'Durban', 'KZN', '4071', 192, 'Job Card Number : 02642\n05.09.2017 & 13.09.2017\n\nAs Per Quote Number: QRB312\nShop Aircon - BE0144\nOption 1 - Refurbished Motor and Pump \n\nScope of Work : Dismantled and assessed pump. Press off impeller. Assessed and test motor winding. Assessed and measure winding protection. Record winding data and connections. Removed damaged winding. Stripped and clean stator core. Re-insulate stator core. Manufactured new winding coils, rewind stator with new coils. Vacuumed varnish impregnate stator with insulating varnish. Bake stator in oven. Removed bearings from rator. Crack test rotor bars. Measure and assessed drive end and non-drive end bearing journals. Overhaul motor.. Supply and fitted new bearings. Removed existing mechanical seal. Assessed and measure mechanical seals journals. Inspected impeller and volute for cracks or key way damaged. Overhaul pump. Supplied and fitted mechanical seal. Reassembled and pressure test. \n\nRe-Installed refurbished motor and pump. Replaced 3 x pulley belts on system and tested all calibrations and settings. \n\n\n', NULL, 1, '2017-09-21 11:43:44'),
