(468, 21, 'INV468', '2017-09-28', '2017-10-31', 0, 1, 0, 2, 0, 'Faith (Zandile) Majozi', 'P.O. Box 40696, Redhill', '', 'Durban', 'KZN', '4071', 192, 'As Per Quote REF#: QRB202\n03.05.2017\nLT Rack Phase Failure \n\nWhile servicing the racks, we have found that phase failure has been bypassed. It is essential to have this safety as it protects the unit (Compressor, electrical components, fan motors, etc) in the event of power fluctuations and surge. ', NULL, 1, '2017-09-28 10:00:43'),
(469, 21, 'INV469', '2017-09-28', '2017-10-05', 0, 0, 0, 2, 0, 'Faith (Zandile) Majozi', 'P.O. Box 40696, Redhill', '', 'Durban', 'KZN', '4071', 192, 'As Per Service Proposal\n02.05.2017 - 10.05.2017\n\nMajor Service - Blowers \n\n1. Used brush to clean fan motors \n2. Sprayed chemical into fins\n3. sprayed with water \n4. Checked drains and made sure they are cleared \n5. Blowers cleaned \n6. Checked electrical connections open covers \n7. Checked for leaks\n8. Checked drain heaters on low temps \n9. Checked evap heaters are are working on low temp\n10. Checked door heaters\n\nSCOPE OF WORK: CABINETS MAJOR SERVICE \n1. Sprayed chemicals into evap coil \n2. Cleaned with hosepipe\n3. Cleared drains, pushed water down \n4. Checked fans \n5. Checked electrical connections\n6. Leak tested \n7. Checked for visible problems\n\nNB: If any Spares, Refrigerant etc are required you will be advised before work is to be done and this will be charged for accordingly. \nEvery Cabinet, Blower, Rack will have a BE Sticker with No and be loaded on our system so we can go and check the hosory to avoid any repeat jobs. \n\nPumped system down, drained oils in compressor and changed oil and driers. ', NULL, 0, NULL),
(470, 14, 'INV470', '2017-09-28', '2017-10-05', 0, 1, 1, 2, 0, 'Barbara Cilliers', 'P.O. Box 391', 'Howick', 'Howick', 'KZN', '3290', 192, 'SPAR ULUNDI\n\n16.09.2017 - Job Card # 02408 / 02409\nPurchase Order # 46456\n\n1.  General Freezer Room not cooling.\nChecked and found both blower coils iced up.  Defrosted ice.  Checked heaters and settings.  All working.  Found the door seals need replacing.\n\n2.  Cake Upright and Fruit & Veg Upright not working\nChecked and found the main isolator burnt as well as the buzzbar.  The store called the electrician.  The electrician replaced the isolator.  Checked the uprights settings and parameters.  All working.', NULL, 0, NULL),
